import React from "react";
import { Link } from "react-scroll"; // Import Link from react-scroll
import { useNavigate } from "react-router-dom";

const Navbar = () => {
  const navigate = useNavigate();

  // Logout function to clear login status and redirect to home
  const handleLogout = () => {
    localStorage.removeItem("isLoggedIn");
    navigate("/");
  };

  return (
    <nav className="backdrop-blur-lg bg-opacity-20 bg-black fixed top-0 w-full p-4 flex justify-between items-center shadow-lg z-50">
      {/* QuickRent Logo - Clicking on this will scroll to the Hero section */}
      <h1 className="text-3xl font-bold text-cyan-400">
        <Link
          to="hero" // This will scroll to the Hero section
          smooth={true}
          duration={500}
          className="cursor-pointer"
        >
          QuickRent
        </Link>
      </h1>

      <ul className="hidden md:flex space-x-6 text-white">
        {/* Updated links using react-scroll's Link component */}
        <li>
          <Link
            to="features"  // Scrolls to the 'features' section
            smooth={true}
            duration={500}
            className="cursor-pointer hover:text-cyan-400 transition"
          >
            Features
          </Link>
        </li>
        <li>
          <Link
            to="gadgets"  // Scrolls to the 'gadgets' section
            smooth={true}
            duration={500}
            className="cursor-pointer hover:text-cyan-400 transition"
          >
            Gadgets
          </Link>
        </li>
        <li>
          <Link
            to="contact"  // Scrolls to the 'contact' section
            smooth={true}
            duration={500}
            className="cursor-pointer hover:text-cyan-400 transition"
          >
            Contact
          </Link>
        </li>
      </ul>

      <button
        onClick={handleLogout}
        className="bg-cyan-400 text-black px-6 py-2 rounded-md hover:bg-cyan-500 transition"
      >
        Logout
      </button>
    </nav>
  );
};

export default Navbar;
